import React, {Component} from 'react';
import axios from 'axios';
import {Link, Redirect} from 'react-router-dom';
import { Jumbotron, Button, Col, Card, CardTitle,CardText } from 'reactstrap';
import { loginAdmin } from './adminfunctions'


export default class Adminlogin extends Component {

    constructor() {
        super()

        this.onChange = this.onChangeID.bind(this)
        this.onChange = this.onChangeKey.bind(this)
        this.onSubmit = this.onSubmit.bind(this)

        this.state = {
          ID: '',
          Key: '',
          errors: {}
        }
      }

      onChangeID(e) {
        this.setState({
            ID: e.target.value
        });
    }

    onChangeKey(e) {
        this.setState({
            Key: e.target.value
        });
    }
      onSubmit(e) {
        e.preventDefault()
        const admin = {
            ID: this.state.ID,
            Key: this.state.Key
          }

          loginAdmin(admin).then(res => {
            if (res) {
              this.props.history.push(`/admindashboard`)
            }
          })
      }

    render() {
        return (
            <div class='container'>
                <Jumbotron>
                <h1 className="display-3">Admin Authentication</h1>
                    <p className="lead">If you don't have an account click below button to register.</p>
                    <hr className="my-2" />
                    <p className="lead">
                    <Link to='/adminregisteration'><Button color="primary">Register</Button></Link>
                    </p>
                </Jumbotron>
                <Col sm='12'>
                        <Card body>
                            <CardTitle><b><h3>Authenticate Yourself</h3></b></CardTitle>
                                <CardText> 
                                <form onSubmit={this.onSubmit}>
                                    <div className="form-group">
                                        <label>ID: </label>
                                        <input  type="text"
                                                className="form-control"
                                                value={this.state.ID}
                                                onChange={this.onChangeID}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <label>Key: </label>
                                        <input  type="text"
                                                className="form-control"
                                                value={this.state.Key}
                                                onChange={this.onChangeKey}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <button className="btn btn-primary" onClick={this.onSubmit}>Login</button>                                        
                                    </div>
                                </form>
                                </CardText>
                        </Card>  
                    </Col>               
            </div>
        )
    }
}
